window.bookSummaryJSON = "<p>Vampire hunter Elena Deveraux wakes from a year-long coma to find that she has become an angel and that her lover, the stunningly dangerous archangel Raphael, likes having her under his control. But almost immediately, Raphael must ready Elena for a flight to Beijing, to attend a ball thrown by the archangel Lijuan.</p> <p>Ancient and without conscience, Lijuan's power lies with the dead. And she has organized the most perfect and most vicious of welcomes for Elena.</p>"; 
